class AppState {
    constructor() {
        this.state = {
            loggedUserneame: {username :""}
        };
    }

    getLoggedUser() {
        return this.state.loggedUserneame.username;
    }

    setLoggedUserId(username) {
        this.state.loggedUserneame.username = username
        
    }
}
const AppInstance = new AppState();
export default AppInstance;
